/**
 * Upload file to DHT
 * @param {Object} obj
 * @param {Object} obj.meta - All the meta associated with file read from the File js object
 * @param {Object} obj.content - base64 encoded content of the file
 * @return {Promise} Promise of a posted upload
 */
export const uploadFile = (obj) => {
    // return fetchPOST('/fn/fileHandler/uploadFile', obj).then(r => r.json());
    //console.log(obj);
    return new Promise((resolve, reject) => {
        setTimeout(() => {
            resolve({
                filePath: obj.meta.path,
                meta: obj.meta,
                content: obj.content, // TODO: remove this
                status: 2
            })
        }, 200);
    });
}